- input: "TEXT\x1CC00028860\x1C.TEXT\x1C\x1CF3XA\x1CThis responds to the FEC letter
    dated December 30, 2009, and signed by Edward D. Ryan of the Reports Analysis
    Division, that seeks further information regarding three contributions made for
    2009 special electionss by the AFT Committee on Political Education (C00028860).
    \ Two contributions of $5,000 each were made to Judy Chu for Congress, the principal
    campaign committee of Congressional candidate Judy Chu who was a candidate for
    two separate special elections in CA 32nd CD:the special general on May 19 and
    the special runoff on July 14.  Amendments are made herewith to identify the two
    lawful contributions with reference to each separate election.  One contribution
    of $5,000 was made to Quigley for Congress to retire debts incurred by the Quigley
    campaign in the special primary election of March 3, 2009, IL 5th  CD.  Amendments
    are made herewith to identify this lawful debt retirement contribution.  Submitted
    by Antonia M. Cortese, Treasurer, American Federation of Teachers, AFL-CIO Committee
    on Political Education.\n"
